import React from "react";

const TableComponent = () => {
    return (
<div class="table-container">
  <div className="table-container">
<table>
        <thead>
            <tr>
                <th>Image</th>
                <th>Name</th>
                <th>Gross Price</th>
                <th>Gross Unit Price</th>
            </tr>
        </thead>
        <tbody id="table-body">
            
        </tbody>
    </table>
</div>
</div>

);
};

export default TableComponent;
